import './Style.css';

function Juego() {

    return (
        <div class="container">
            <button class="arrow-up">&#9650;</button>
            <div class="square">
                <input type="text" id="numberInput" value="0"></input>
            </div>
            <button class="arrow-down">&#9660;</button>
        </div>

    );
}

export default Juego;
